{
   "components":[
{
         "xtype":"panel",
"title":"Toelichting",
"collapsible":true,
"html":"<div><ul><li>Bij het opstellen van de work breakdown (opgesteld iom Henk) is rekening gehouden met de manier waarop het werk per werkvak opgeleverd en betaald wordt. Daarom heb ik de keuringen per paal voor \”draagconstructies\” opgesplitst per werkvak&nbsp;<br></li><li>Mocht je toch deze palen als 1 lijst willen hebben: dit is technisch mogelijk maar zou je dan moeten afstemmen met Henk omdat dit niet de \”oplever\” breakdown volgt</li><li>De keuringen per paal voor de rijdraden gaan nog steeds per draad.&nbsp;<br></li><li>Ik heb de \”labels\” (S1, S2) van de keuringscriteria in het systeem gezet, maar nog niet alle namen - dit is later aan te vullen. Ik zie dat deze namen vrij lang zijn, het is te overwegen maar een deel van de naam op te nemen<br></li><li>Ieder criterium heeft 1 ontwerpwaarde (label \”- ontwerp\”) en 1 gemeten waarde zodat je per paal/keuringspunt criteria kunt ingeven. de ontwerpwaarden gaan voor reguliere gebruikers \”read only\” worden.<br></li><li>Als je kolommen weet waar (bijna) alle waarden hetzelfde zijn (bv. \”NVT\”), kun je die aan ons doorgeven, dan zetten wij die als standaardwaarden erin en hoef je bij het maken van nieuwe palen niet steeds diezelfde waarden in te vullen. Het is aan te raden dit aan ons door te geven voordat je op grotere schaal palen gaat aanmaken<br></li></ul><div><br></div></div>"

